const FileList = ({ files, onParse }) => {
    return (
      <div className="mt-4">
        <h3 className="text-lg font-bold">Uploaded Files</h3>
        <ul>
          {files.map((file) => (
            <li key={file.file_id} className="p-2 border rounded-md">
              {file.filename}
              <button
                onClick={() => onParse(file.file_id)}
                className="ml-2 text-blue-500 underline"
              >
                Parse
              </button>
            </li>
          ))}
        </ul>
      </div>
    );
  };

  export default FileList;
